"use strict";function setWithExpiry(e,t,r){var a={value:t,expiry:(new Date).getTime()+r};localStorage.setItem(e,JSON.stringify(a))}function getWithExpiry(e){var t=localStorage.getItem(e);if(!t)return null;var r=JSON.parse(t);return(new Date).getTime()>r.expiry?(localStorage.removeItem(e),null):r.value}